,0xff00,0xff0000,0xff,0xff00,0xff0000,0x0,0x80,0x8080,0x808080,0x808000,0x8000a0,0xa0a0,0xa0a0a4,0xa0a400,0xa400ff,0xfffb,0xfffbf0,0xfbf000,0xf00000


.text

# s4 stores the starting value of doodle
# t9 stores the number of loops
# s6 stores boolean for enemy presence
# a3 stores the score.
# s3 stores value for the fourth platform
# s2 stores value for the third platform
# s1 stores value for the second platform
# s0 stores value for the first platform
# a2 stores boolean for collision decisions 
Main:
addi $t9, $zero, 0
lw $t0, displayAddress 	# $t0 stores the base address of display
addi $s4, $t0, 15456		

addi $s0, $t0, 1600		# first platform pixel
addi $s1, $t0, 5456		# second platform
addi $s2, $t0, 9088		# third platform
addi $s3, $t0, 13220		# fourth platform
#addi $a3, $zero, 1               # stores score
lw $t1, score($zero)	
la $t1, score		
li $t2, 1			
sw $t2, 0($t1)
addi $s6, $zero, 0 		# sets enemy presence to zero

addi $a2, $zero, 9


Play:	addi $t9, $t9, 1

	lw $t0, displayAddress 		# $t0 stores the base address for display
	addi $t1, $t0, 16000
	bge $s4, $t1, Retry
	
	beq $t9, $zero, Exit
	
	jal BackgroundPaintFunc     # call to the function that paints background
		
	# 1st platform
	lw $t0, displayAddress 		# $t0 stores the base address for display
	addi $sp, $sp, -4		# push s0 (first platform) value onto stack
	sw $s0, 0($sp)
	jal PlatformDrawFunc
	# 2nd platform
	lw $t0, displayAddress 		
	addi $sp, $sp, -4		# push s1 (second platform) value onto stack
	sw $s1, 0($sp)
	jal PlatformDrawFunc
	# 3rd platform
	lw $t0, displayAddress 		# $t0 stores the base address for display
	addi $sp, $sp, -4		
	sw $s2, 0($sp)
	jal PlatformDrawFunc	
	# 4th platform
	lw $t0, displayAddress 		# $t0 stores the base address for display
	addi $sp, $sp, -4		# push s3 (fourth platform) value onto stack
	sw $s3, 0($sp)
	jal PlatformDrawFunc
	
	addi $t0, $zero, 3
	bge $t0, $t9, BasePlatform
	j ReloadTopPlatform

BasePlatform:
	lw $t0, displayAddress 		# $t0 stores the base address for display
	addi $t3, $t0, 16200		# t3 stores initial value of platform	
	addi $sp, $sp, -4		# push t3 to stack
	sw $t3, 0($sp)			# fixing pointer
	jal PlatformDrawFunc
	
	
ReloadTopPlatform:# platform on top recreate
	lw $t0, displayAddress 		# $t0 stores the base address for display
	addi $t1, $t0, 15872
	add $t2, $s3, $zero
	bge $t2, $t1, ReloadPlatform1
	j Reassign1


# REASSIGNING 
ReloadPlatform1:
	jal RandomPlatform
	lw $s3, 0($sp)		
	addi $sp, $sp, 4
	j JumpLoop


Reassign1:
	lw $t0, displayAddress 		# $t0 stores the base address for display
	addi $t1, $t0, 15872
	add $t2, $s2, $zero
	bge $t2, $t1, ReloadPlatform2
	j Reassign2


# random platform selection function
ReloadPlatform2:
	jal RandomPlatform
	lw $s2, 0($sp)		
	addi $sp, $sp, 4
	j JumpLoop

Reassign2:
	lw $t0, displayAddress 		# $t0 stores the base address for display
	addi $t1, $t0, 15872
	add $t2, $s1, $zero
	bge $t2, $t1, ReloadPlatform3
	j Reassign3


# reload platform 3
ReloadPlatform3:
	jal RandomPlatform
	lw $s1, 0($sp)		
	addi $sp, $sp, 4
	j JumpLoop
 
Reassign3: 
	lw $t0, displayAddress 		# $t0 stores the base address for display
	addi $t1, $t0, 15872
	add $t2, $s0, $zero
	bge $t2, $t1, ReloadPlatform4
	j JumpLoop


# rreload platform 
ReloadPlatform4:
	jal RandomPlatform
	lw $s0, 0($sp)		
	addi $sp, $sp, 4 
	
# Calls sprite's jump method
JumpLoop:
	jal DoodleJump


Reassign4:	#
	addi $t1, $zero, 7
	div $t9, $t1
	mfhi $t1
	beq $t1, $zero, updatePlatforms
	j KeyPressCheck
	
# makes platforms flow down
updatePlatforms:
	addi $s3, $s3, 512
	addi $s2, $s2, 512
	addi $s1, $s1, 512
	addi $s0, $s0, 512
	
KeyPressCheck:
	lw $t8, 0xffff0000
 	beq $t8,0x1,KeyboardInput
 	j SpriteDrawFuncLoop
 	
KeyboardInput:
	lw $t2, 0xffff0004

	beq $t2, 0x6A, respond_to_j
	beq $t2, 0x6B, respond_to_k 
	
	j SpriteDrawFuncLoop
	
respond_to_j:

	addi $s4, $s4, -4
	j SpriteDrawFuncLoop

respond_to_k:

	addi $s4, $s4, 4
	j SpriteDrawFuncLoop
 	
SpriteDrawFuncLoop:
	addi $sp, $sp, -4		# push $s4 value onto stack
	sw $s4, 0($sp)
	jal SpriteDrawFunc
	jal Score
	addi $t1, $t1, 5
	lw $t2, score($zero)
	div $t2, $t1
	mfhi $t1			# call to SpriteDrawFunc function
	bne $t1, $zero, Endloop
	jal DrawMessage				
													# call to score		
Endloop:li $v0, 32
 	li $a0, 200
 	syscall
	j Play

