# generates random [platforms 
RandomPlatform:
	lw $t0, displayAddress 		# $t0 stores the base address for display
	
	li $v0, 42
	li $a0, 0
	li $a1, 50 # random number from 0-50
	syscall
	
	add $t3, $zero, $a0 		# updated t3 
	addi $t1, $zero, 4		
	mult $t3, $t1
	mflo $t3			
	add $t3, $t3, $t0		
	
	addi $sp, $sp, -4		#  push pixel value onto Stack
	sw $t3, 0($sp)
	jr $ra
												
Retry:	
	lw $t0, displayAddress # t0 stores the base address for display
	la $t1, exitImage # t1 stores image address
	addi $t2, $zero, 4096 # end pixel of the display
	add $t3, $zero, $zero # image address pointer
	addi $s6, $s6, 3
	
RetryBackground:
	beq $t2, $zero, RetryPrompt  # exit condition
	add $t4, $t1, $t3 #gives memory of piexel
	lw $t5, 0($t4)
	sw $t5, 0($t0) 			  # paints a pixel
	addi $t2, $t2, -1 		 
	addi $t3, $t3, 4
	add $t0, $t0, 4 		 
	j RetryBackground 	     	  # loop jump
	
RetryPrompt:
	lw $t8, 0xffff0000
 	beq $t8,0x1,KeyboardInput2
 	beq $t6, $zero, RetryExit
 	li $v0, 32
 	li $a0, 100
 	syscall
 	addi $t6, $t6, -1
 	j RetryPrompt	
RetryExit:
	j Exit
	
KeyboardInput2:
	lw $t2, 0xffff0004
 	beq $t2, 0x73, respond_to_s
 	j SpriteDrawFuncLoop
 	
respond_to_s:
	j Main		



DoodleJump:
	addi $sp, $sp, -4		#  push return address on the stack.
	sw $ra, 0($sp)
	jal PlatformJump               # call platform jump
	lw $t7, 0($sp)			
	addi $sp, $sp, 4
	
	lw $ra, 0($sp)			
	addi $sp, $sp, 4
	
	beq $t7, $zero, JumpUp		# jump up if zero is returned
	
	addi $t8, $zero, 1		
	bge $a2, $t8, JumpUp		
	
Fall:
	addi $s4, $s4, 256
	jr $ra

JumpUp:
	addi $s4, $s4, -512
	addi $a2, $a2, -1
	jr $ra
	

PlatformJump:
	lw $t0, displayAddress 		
	addi $a1, $s4, 512		
	add $t5, $s3, $zero		
	add $t6, $s2, $zero
	add $t7, $s1, $zero
	add $t8, $s0, $zero
	addi $t2, $zero, 14	
CollissionCheck:
	beq $t2, $zero, FallThrough
	beq $a1, $t5, Jump
	beq $a1, $t6, Jump
	beq $a1, $t7, Jump
	beq $a1, $t8, Jump
	addi $t5, $t5, 4
	addi $t6, $t6, 4
	addi $t7, $t7, 4
	addi $t8, $t8, 4
	addi $t2, $t2, -1
	j CollissionCheck

FallThrough:
	addi $t1, $zero, 1
	addi $sp, $sp, -4		
	sw $t1, 0($sp)
	jr $ra

Jump:
	addi $a2, $zero, 9
	addi $t1, $zero, 0
	addi $sp, $sp, -4		
	sw $t1, 0($sp)
	#
	la $t1, score	
	lw $t2, score($zero)
	addi $t3, $t2, 1
	sw $t3, 0($t1)
	jr $ra
	
	
# Draws the background of the game
BackgroundPaintFunc:
	lw $t0, displayAddress # t0 stores the base address for display
	la $t1, image # t1 stores image address
	addi $t2, $zero, 4096 # end pixel of the display
	add $t3, $zero, $zero # image address pointer
	
Background:
	beq $t2, $zero, BackgroundExit  # exit condition
	add $t4, $t1, $t3 #gives memory of piexel
	lw $t5, 0($t4)
	sw $t5, 0($t0) 			  # paints a pixel
	addi $t2, $t2, -1 		 
	addi $t3, $t3, 4
	add $t0, $t0, 4 		 
	j Background 	     	  # loop jump

BackgroundExit:
	jr $ra
	

SpriteDrawFunc:
	lw $t4, 0($sp)		# pop initial position of sprite from stack
	addi $sp, $sp, 4	# fix pointer
	lw $t1, red		# loads orange into t1
	lw $t2, yellowgreen
	lw $t6, white	# loads yellow into t2
	sw $t2, 4($t4)
	sw $t2, 8($t4)
	sw $t6, 12($t4)
	sw $t2, 16($t4)
	sw $t2, 20($t4)
	addi $t4, $t4, -256 # changes to above line
	sw $t1, 0($t4)
	sw $t1, 4($t4)
	sw $t1, 8($t4)
	sw $t1, 12($t4)
	sw $t1, 16($t4)
	sw $t1, 20($t4)
	sw $t1, 24($t4)
	addi $t4, $t4, -256
	sw $t2, 0($t4)
	sw $t2, 4($t4)
	sw $t2, 8($t4)
	sw $t2, 12($t4)
	sw $t2, 16($t4)
	sw $t2, 20($t4)
	sw $t2, 24($t4)
	addi $t4, $t4, -256
	sw $t1, 0($t4)
	sw $t1, 4($t4)
	sw $t1, 8($t4)
	sw $t1, 12($t4)
	sw $t1, 16($t4)
	sw $t1, 20($t4)
	sw $t1, 24($t4)
	addi $t4, $t4, -256
	sw $t2, 4($t4)
	sw $t2, 8($t4)
	sw $t2, 12($t4)
	sw $t2, 16($t4)
	sw $t2, 20($t4)
	addi $t4, $t4, -256
	sw $t1, 8($t4)
	sw $t2, 12($t4)
	sw $t1, 16($t4)
	jr $ra # jump back to main loop


PlatformDrawFunc: 
	lw $t4, 0($sp) # takes value off of stack
	addi $sp, $sp, 4
	#addi $t4, $t0, 1600 # set initial pos of sprite
	addi $t3, $t4, 256 
	addi $t5, $zero, 14
	lw $t1, green
	lw $t2, brown
DrawLoop:
	beq $t5, $0, DrawExit
	sw $t1, 0($t4)	
	sw $t2, 0($t3)
	addi $t4, $t4, 4
	addi $t3, $t3, 4
	addi $t5, $t5, -1
	j DrawLoop				
DrawExit:	
	jr $ra


# SCORING
Score:
	lw $t2, score($zero)
	
	addi $t3, $t3, 10 # putting 10 in t3
	div $t2, $t3
	
	mfhi $t3 	# stores ones digit
	mflo $t4 	# stores tens digit
	
	addi $sp, $sp, -4
	sw $t4, 0($sp)
	
	addi $sp, $sp, -4
	sw $t3, 0($sp)

OnesCall:
	j DrawOnes

TensCall:
	j DrawTens

EndOfScore:

	jr $ra
			
DrawOnes:
	lw $t3, 0($sp)
	addi $sp, $sp, 4
	add $t5, $zero, $zero # setting compare value
	beq $t3, $t5, DrawZeroOnes		
