	beq $t3, $t5, DrawSevenOnes
	addi $t5, $zero, 8 # setting compare value
	beq $t3, $t5, DrawEightOnes
	addi $t5, $zero, 9 # setting compare value
	beq $t3, $t5, DrawNineOnes

